/*** Save-Data Header ***/

var saveDataHeader = {
    name: 'Save-Data',
    value: 'on'
};
var onAddSaveDataHeader = function (details) {
    details.requestHeaders.push(saveDataHeader);
    return {requestHeaders: details.requestHeaders};
};
var setSaveData = function () {
    chrome.webRequest.onBeforeSendHeaders.addListener(
        onAddSaveDataHeader,
        {urls: ['http://*/*', 'https://*/*']},
        ['requestHeaders', 'blocking']
    );
};
var unsetSaveData = function () {
    chrome.webRequest.onBeforeSendHeaders.removeListener(onAddSaveDataHeader);
};
var triggerSaveData = function () {
    if (saveDataMode) {
        setSaveData();
    } else {
        unsetSaveData();
    }
};
triggerSaveData();

/*** Ad Block ***/

var onCancel = function (details) {
    return {cancel: true};
};
var setAdBlock = function () {
    chrome.webRequest.onBeforeRequest.addListener(
        onCancel,
        {urls: blocked.split('\n').filter(function (e) { return e; })},
        ['blocking']
    );
};
var unsetAdBlock = function () {
    chrome.webRequest.onBeforeRequest.removeListener(onCancel);
};
var triggerAdBlock = function () {
    if (adBlockMode) {
        setAdBlock();
    } else {
        unsetAdBlock();
    }
};
triggerAdBlock();